import React from 'react';

const DashboardAdmin = () => {
  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Admin Dashboard</h1>
      <p className="text-gray-700">Manage users, stores, and reviews.</p>
    </div>
  );
};

export default DashboardAdmin;
